import './App.css';
import React, {useState, useEffect} from "react";

function App() {

  const [photos, setPhotos] = useState([])

  useEffect(() => {
    fetch('http://0.0.0.0:4000/')            
    .then(res => res.json())
    .then(data => setPhotos(data))
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <h1>My Flickr App</h1>
      </header>
      <article>
        <p>{photos}</p>
      </article>
    </div>
  );
}

export default App;
